extension.description.full.message:
PreMiD on lihtne ja konfigureeritav utiliit, mis võimaldab teil Discordis praegu esitatavas olekus näidata, mida te veebis teete.

Näiteks kui hakkate YouTube'is videot vaatama, haarab meie laiendus lehelt kogu vajaliku teabe ja saadab selle meie rakendusele, mis seejärel määrab teie Discordi profiili oleku.

PreMiD toetab enam kui 500 veebisaiti ja töötab endiselt tänu oma tugevale kogukonnale, mis lisab iga päev uusi olekuid.

PreMiD kasutamiseks peate lisama selle laienduse ja installima meie veebisaidilt leitud ametliku PreMiD rakenduse. Selle põhjuseks on piirangud Discordi Rich Presence-i SDK toimimisel.

